import { Typography } from "@material-ui/core";

import React, { Component } from "react";

class Home extends Component {
  render() {
    return (
      <div>
        <Typography variant="h1" component="h2">
          h1. Heading
        </Typography>
      </div>
    );
  }
}

export default Home;
